import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css'
import './App.css';
import Header from './components/Header';
import Nav_content from './components/Nav_content';

const App = () => {
  return (
    <div className='app-wrapper container-fluid'>
      <Header />
      <Nav_content />
    </div>
  );
}
export default App;
